import React, { Component } from 'react';
import Products from "./Products";
import Card from './Card';

class Filters extends Component {
	
	
	render() {
		return (
			<div className="Filters">
				
				<h2>Filtered by:</h2>
				<a className="fl" id="SHOW" href="/">{this.props.show} <span className="badge pull-right">0</span> </a>
				<h2>Gender</h2>
				<a className="fl" id="MALE" href="/">{this.props.male} <span className="badge pull-right">0</span> </a>
				<a className="fl" id="FEMALE" href="/">{this.props.female} <span className="badge pull-right">0</span> </a>
				<h2>Brand</h2>
				<a className="fl" id="GRAND" href="/">{this.props.legrand} <span className="badge pull-right">0</span> </a>
				<a className="fl" id="KROSS" href="/">{this.props.kross} <span className="badge pull-right">0</span> </a>
				<a className="fl" id="EXPLORER" href="/">{this.props.explorer} <span className="badge pull-right">0</span> </a>
				<a className="fl" id="VISITOR" href="/">{this.props.visitor} <span className="badge pull-right">0</span> </a>
				<a className="fl" id="PONY" href="/">{this.props.pony} <span className="badge pull-right">0</span> </a>
				<a className="fl" id="FORCE" href="/">{this.props.force} <span className="badge pull-right">0</span> </a>
				<a className="fl" id="E-BIKES" href="/">{this.props.ebikes} <span className="badge pull-right">0</span> </a>
				<a className="fl" id="IDEAL" href="/">{this.props.ideal} <span className="badge pull-right">0</span> </a>
			</div>
		);
	}
}
export default Filters;
